import React from "react";

function Food({ name, picture }) {
  return (
    <div>
      <h2> I love {name}</h2>
      <img src={picture} alt={name}></img>
    </div>
  );
}

const foodILike = [
  {
    id: 1,
    cuisine: "Bun Cha",
    image:
      "data:image/jpeg;base64,",
  },
  {
    id: 2,
    cuisine: "Bun Cha",
    image:
      "data:image/jpeg;base64,",
  },
];

function App() {
  return (
    <div>
      {foodILike.map((dish) => (
        <Food key={dish.id} name={dish.cuisine} picture={dish.image} />
      ))}
    </div>
  );
}

export default App;
